                config: 3600,
                configHumanize: "an hour"
            },
            {
                name: "rule-2073-5f801b7b3d60a10017e24820",
                lastTime: 1638286220,
                lastTimeHumanize: "8 minutes",
                status: 1,
                config: 3600,
                configHumanize: "an hour"
            }
        ],
            mongo: [
            {
                name: "Local Mongo",
                status: 1
            }
        ],
            urls: [
            {
                name: "https://google.com",
                status: 1,
                time: 414
            },
            {
                name: "https://native.theoptimizer.io",
                status: 1,
                time: 874
            }
        ]
    };
    const uiNames = {
        lastActivities: 'Last Activities',
        mongo: 'Mongo DB Health Check'
    }
    Object.keys(activities).forEach(name => {
        const values = activities[name];
        const generalStatus = values.find(e => !e.status)
        $('#monitorsList').append(`
                <li class="list-group-item" id="${name}">
                 <div class="d-flex justify-content-between">
                    <h6  style="cursor: pointer"><i id="${name}-icon" class="fa fa-chevron-right" style="font-size: 12px; margin-right: 6px;"></i>
                       ${uiNames[name]}
                    </h6>
                    <span id="${name}-status" class="${generalStatus ? 'text-danger' : 'text-success'}">${generalStatus ? 'ERROR' : 'OK'}</span>
                 </div>
                </li>
            `)
        if (values.length) {
            $(`#${name}`).append(`<ul class="list-group list-group-flush collapse" id="${name}-nestedList">
                   ${values.map(v => `
                    <li
                        class="list-group-item "
                        style="border-bottom: 0;padding-left: 1.3rem;"
                    >
                        <div class="d-flex justify-content-between">
                            <span>${v.name}</span>
                            <span class="${v.status ? 'text-success' : 'text-danger'}">${v.status ? 'OK' : 'ERROR'}</span>

                        </div>
                    </li>

                   `).join('')}
            </ul>`);
        }

        $(`#${name}`).click(function (el) {
            $(`#${name}-icon`).toggleClass('fa-chevron-down fa-chevron-right')
            $(`#${name}-nestedList`).toggleClass('show')
            $(`#${name}-status`).toggle()
        })
    })

</script>
</body>
